import  actionTypes  from "./actionTypes";


export const googleSignInStart=()=>({
  type:actionTypes.GOOGLESIGNINSTART
})
export const signInSuccess=(user)=>({
  type:actionTypes.GOOGLESIGNINSUCCESS,
  payload:user
})
export const SignInFailure=(error)=>({
  type:actionTypes.GOOGLESIGNINFAILURE,
  payload:error
})

export const emailSignInStart=(emailAndPass)=>({
  type:actionTypes.EMAILSIGNINSTART,
  payload:emailAndPass
})
export const emailSignInSuccess=(user)=>({
  type:actionTypes.EMAILSIGNINSUCCESS,
  payload:user
})
export const emailSignInFailure=(error)=>({
  type:actionTypes.EMAILSIGNINFAILURE,
  payload:error
})
